- input: "TEXT\x1CC00142596\x1CTEXT-2009-Q3\x1C\x1CF3XA\x1CIN RESPONSE TO A LETTER
    FROM THE FEC DATED MARCH 5, 2010, WE ARE AMENDING THE 3RD AND 4TH QUARTER 2009
    FEC FORM 3X REPORTS FOR COMPASS BANCSHARES INC PAC (C00142596) TO CORRECT AN OVER-THE-LIMIT
    SITUATION WITH AL BankPAC (C00367094). A REFUND FOR THE OVER-LIMIT AMOUNT OF $2,500
    WAS ISSUED BY AL BankPAC ON 08/20/09 BUT WAS INADVERTETLY DEPOSITED IN THE WRONG
    ACCOUNT. WE HAVE CORRECTED THE SITUATION, AND THE AMENDED REPORTS FOR THE 3RD
    AND 4TH QUARTER 2009 WILL SHOW THAT OUR TOTAL NET CONTRIBUTION TO AL BankPAC FOR
    2009 WAS $5,000.\n"
